void tivxAddTargetKernelDofVisualize(void)
{
    vx_status status = VX_FAILURE;
    char target_name[TIVX_TARGET_MAX_NAME];
    vx_enum self_cpu;

    self_cpu = tivxGetSelfCpuId();

    if ( self_cpu == TIVX_CPU_ID_IPU1_0 )
    {
        strncpy(target_name, TIVX_TARGET_IPU1_0, TIVX_TARGET_MAX_NAME);
        status = VX_SUCCESS;
    }
    else
    {
        status = VX_FAILURE;
    }

    if (status == VX_SUCCESS)
    {
        vx_dof_visualize_target_kernel = tivxAddTargetKernelByName(
                            TIVX_KERNEL_DOF_VISUALIZE_NAME,
                            target_name,
                            tivxDofVisualizeProcess,
                            tivxDofVisualizeCreate,
                            tivxDofVisualizeDelete,
                            tivxDofVisualizeControl,
                            NULL);
    }
}

void tivxRemoveTargetKernelDofVisualize(void)
{
    vx_status status = VX_SUCCESS;

    status = tivxRemoveTargetKernel(vx_dof_visualize_target_kernel);
    if (status == VX_SUCCESS)
    {
        vx_dof_visualize_target_kernel = NULL;
    }
}

static uint16_t g_vx_dof_visualise_lut_bpp = 2;
static uint16_t g_vx_dof_visualise_lut_w = 129;
static uint16_t g_vx_dof_visualise_lut_h = 129;
extern const uint8_t g_vx_dof_visualise_lut_129x129_rgb565_0[];

static void visualizeFlowAndConfidance2(
                uint32_t *flow_ptr,
                int size[2], /* [0] = height in lines, [1] = stride/width in pixels*/
                uint8_t *rgb_ptr,
                uint8_t *confidence_ptr,
                uint32_t valid_width, /* valid width in pixels */
                uint32_t rgb_stride, /* in bytes */
                uint32_t confidence_stride, /* in bytes */
                uint32_t confidence_threshold
             )
{
    uint16_t x, y;
    uint32_t cur_flow;
    uint16_t c;
    int16_t u, v;
    uint8_t r, g, b;
    uint16_t rgb565;
    uint8_t *cur_ptr;
    uint32_t lut_index, lut_size;
    int16_t lut_offset;
    uint16_t *lut_ptr;
    uint16_t lut_w, lut_h, lut_bpp;

    lut_w = g_vx_dof_visualise_lut_w;
    lut_h = g_vx_dof_visualise_lut_h;
    lut_bpp = g_vx_dof_visualise_lut_bpp;
    lut_ptr = (uint16_t*)g_vx_dof_visualise_lut_129x129_rgb565_0;

    lut_offset = lut_w/2;
    lut_size = (lut_w*lut_h*lut_bpp);

    for(y=0; y<size[0]; y++)
    {
        for(x=0;x<valid_width; x++)
        {
            rgb565 = 0;

            cur_flow = (int32_t)flow_ptr[ y*size[1] + x ];
            c = (uint16_t)(cur_flow & 0x0000000F);
            u = (int16_t)((int32_t)cur_flow >> 16);
            v = (int16_t)(((int32_t)((int32_t)cur_flow << 16)) >> 20);

            confidence_ptr[y*confidence_stride + x] = c << 4;

            if( c > confidence_threshold)
            {
                if(v > lut_offset)
                    v =  lut_offset;
                if(v < (-lut_offset) )
                    v = -lut_offset;
                if(u > lut_offset)
                    u =  lut_offset;
                if(u < (-lut_offset))
                    u = -lut_offset;

                u += lut_offset;
                v += lut_offset;

                lut_index = v * g_vx_dof_visualise_lut_w + u;

                if(lut_index < lut_size)
                {
                    rgb565 = lut_ptr[lut_index];
                }
            }
            r  = (rgb565 & 0xF800) >> (11-3);
            g  = (rgb565 & 0x07E0) >> (5-2);
            b  = (rgb565 & 0x001F) << (3);

            cur_ptr = &rgb_ptr[y*rgb_stride + x*3];
            cur_ptr[0] = r;
            cur_ptr[1] = g;
            cur_ptr[2] = b;
        }
    }

    #if 0
    {
        uint16_t ovly_lut_w, ovly_lut_h;

        /* overlay LUT on RGB output */
        ovly_lut_h = lut_h;
        ovly_lut_w = lut_w;

        if(ovly_lut_h > size[0])
            ovly_lut_h = size[0];
        if(ovly_lut_w > valid_width)
            ovly_lut_w = valid_width;

        for(y=0; y<ovly_lut_h; y++)
        {
            for(x=0;x<ovly_lut_w; x++)
            {
                rgb565 = 0;

                lut_index = y * lut_w + x;

                if(lut_index < lut_size)
                {
                    rgb565 = lut_ptr[lut_index];
                }
                r  = (rgb565 & 0xF800) >> (11-3);
                g  = (rgb565 & 0x07E0) >> (5-2);
                b  = (rgb565 & 0x001F) << (3);

                cur_ptr = &rgb_ptr[y*rgb_stride + x*3];
                cur_ptr[0] = r;
                cur_ptr[1] = g;
                cur_ptr[2] = b;
            }
        }
    }
    #endif
}

